Actionscript.script:
import flash.display.MovieClip;

visible = false;
var id:Number;
if (!id) id = 0;
var textClip:MovieClip;

stop();

function init ():void {
	gotoAndPlay("over");
}

function update ():void {
	for (var i:int = 0; i < 4; i ++) {
		if (this["ring"+i]) this["ring"+i].update();
	}
}

function select ():void {
	if (textClip) {
		gotoAndPlay("over");
		textClip.gotoAndPlay("over");
	}
}
function unselect ():void {
	if (textClip) {
		gotoAndPlay("out");
		textClip.gotoAndPlay("out");
	}
}
